lines = []
inputs = []
input0 = ''
input1 = ''
input2 = ''
input3 = ''
input4 = ''

inputs.push(input0, input1, input2, input3, input4)

inputs.each do |input|
  lines << input.chars
end

keypad = [[1,2,3],[4,5,6],[7,8,9]]


password = []

lines.each do |line|
  x_coord = 1
  y_coord = 1
  line.each do |char|
    case char
    when 'U'
      y_coord -= 1
    when 'D'
      y_coord += 1
    when 'L'
      x_coord -= 1
    when 'R'
      x_coord += 1
    end
    y_coord = [[y_coord, 2].min, 0].max
    x_coord = [[x_coord, 2].min, 0].max
  end
  password << keypad[y_coord][x_coord]
end

puts password
